import React from 'react';
import UserImg from "../../../../Assests/Images/avatar/female.svg"

function ChangeProfile() {
    return (
        <>
            <img
            src={UserImg}
            className=" border rounded-circle bg-white position-absolute top-0 end-0 translate-middle-y me-2"
            alt=""
            width="100"
            height="100"
          />
        </>
    )
}

export default ChangeProfile
